/* eslint-disable func-style */
/* eslint-disable max-len */
/* eslint-disable require-jsdoc */
function addBlocks (Blockly) {
    const color = '#42CCFF';
    const tb4IconUrl = 'data:image/png;base64,';
    
    Blockly.Blocks.tb4_init = {
        init: function () {
            this.jsonInit({
                message0: '%1',
                message1: Blockly.Msg.PINFOURTUBE_INIT,
                args0: [
                    {
                        type: 'field_image',
                        src: tb4IconUrl,
                        width: 50,
                        height: 27
                    }
                ],
                colour: color,
                extensions: ['shape_statement']
            });
        }
    };

    Blockly.Blocks.tb4_number = {
        init: function () {
            this.jsonInit({
                message0: '%1',
                message1: Blockly.Msg.PINFOURTUBE_STRING,
                args0: [
                    {
                        type: 'field_image',
                        src: tb4IconUrl,
                        width: 50,
                        height: 27
                    }
                ],
                args1: [
                    {
                        type: 'input_value',
                        name: 'NUM'
                    },
                    {
                        type: 'field_dropdown',
                        name: 'state',
                        options: [
                            ['0', '-1'],
                            ['1', '1'],
                            ['2', '2'],
                            ['3', '3'],
                            ],
                    }
                ],
                colour: color,
                extensions: ['shape_statement']
            });
        }
    };

    Blockly.Blocks.tb4_dot = {
        init: function () {
            this.jsonInit({
                message0: '%1',
                message1: Blockly.Msg.PINFOURTUBE_DOT,
                args0: [
                    {
                        type: 'field_image',
                        src: tb4IconUrl,
                        width: 50,
                        height: 27
                    }
                ],
                args1: [
                    {
                        type: 'field_dropdown',
                        name: 'dot',
                        options: [
                            ['1', '0'],
                            ['2', '1'],
                            ['3', '2'],
                            ['4', '3']
                            ],
                    },
                    {
                        type: 'field_dropdown',
                        name: 'state',
                        options: [
                            ['ON', 'true'],
                            ['OFF', 'false']
                            ],
                    }
                ],
                colour: color,
                extensions: ['shape_statement']
            });
        }
    };

    Blockly.Blocks.tb4_state = {
        init: function () {
            this.jsonInit({
                message0: '%1',
                message1: Blockly.Msg.PINFOURTUBE_STATE,
                args0: [
                    {
                        type: 'field_image',
                        src: tb4IconUrl,
                        width: 50,
                        height: 27
                    }
                ],
                args1: [
                    {
                        type: 'field_dropdown',
                        name: 'state',
                        options: [
                            ['clear', 'tm_4display.clear();'],
                            ['ON', 'tm_4display.displayOn();'],
                            ['OFF', 'tm_4display.displayOff();']
                            ],
                    }
                ],
                colour: color,
                extensions: ['shape_statement']
            });
        }
    };


    return Blockly;
}

exports = addBlocks;
